#include "fssimplewindow.h"

extern int wid,hei;
extern unsigned char rgb[];

void flipImageVertically(unsigned char *image, int width, int height)
{
    int rowSize = width * 3;  

    for (int row = 0; row < height / 2; ++row)
    {
        int oppositeRow = height - 1 - row;

        for (int col = 0; col < rowSize; ++col)
        {
            unsigned char temp = image[row * rowSize + col];
            image[row * rowSize + col] = image[oppositeRow * rowSize + col];
            image[oppositeRow * rowSize + col] = temp;
        }
    }
}

int calculateColorDistanceSquared(unsigned char c1[], unsigned char c2[]) {
    int dr = c1[0] - c2[0];
    int dg = c1[1] - c2[1];
    int db = c1[2] - c2[2];

    return dr * dr + dg * dg + db * db;
}

void updatePixelColor(unsigned char &r, unsigned char &g, unsigned char &b) {
    unsigned char red[] = {255, 0, 0};
    unsigned char yellow[] = {255, 255, 0};
    unsigned char black[] = {0, 0, 0};
	unsigned char tempDist[] = {r, g, b};

    int distToRed = calculateColorDistanceSquared(tempDist, red);
    int distToYellow = calculateColorDistanceSquared(tempDist, yellow);
    int distToBlack = calculateColorDistanceSquared(tempDist, black);

    if (distToRed <= distToYellow && distToRed <= distToBlack) {
        r = red[0];
        g = red[1];
        b = red[2];
    } else if (distToYellow <= distToRed && distToYellow <= distToBlack) {
        r = yellow[0];
        g = yellow[1];
        b = yellow[2];
    } else {
        r = black[0];
        g = black[1];
        b = black[2];
    }
}


int main(void)
{
	int spcKey = 0;
	bool flipped = false;
	FsOpenWindow(0,0,400,400,1);
	for(;;)
	{
		glClear(GL_COLOR_BUFFER_BIT|GL_DEPTH_BUFFER_BIT);
		FsPollDevice();
		auto key=FsInkey();
		if(FSKEY_ESC==key)
		{
			break;
		}
		else if (FSKEY_SPACE == key){
			spcKey++;
		}

		
		if ((spcKey == 1) & (flipped == false)){
			flipImageVertically(rgb, wid, hei);
			flipped = true;
		}
		else if (spcKey == 2){
			for (int y = 0; y < hei; ++y) {
            for (int x = 0; x < wid; ++x) {
				int flippedY = hei - 1 - y;
	            int index = (flippedY * wid + x) * 3; 

                unsigned char &r = rgb[index];
                unsigned char &g = rgb[index + 1];
                unsigned char &b = rgb[index + 2];
                updatePixelColor(r, g, b);
            }
        }
		}

		glRasterPos2i(1,399);
		glDrawPixels(wid,hei,GL_RGB,GL_UNSIGNED_BYTE,rgb);

		FsSwapBuffers();
	}
	return 0;
}



